def _canonicalize_tool_args(obj: Any) -> Any:
    """
    Canonicalize tool arguments for stable fingerprinting.

    Recursively processes an object to ensure consistent representation:
    - Sorts dictionary keys recursively
    - Converts tuples to lists
    - Trims leading/trailing whitespace from strings
    - Preserves numeric and boolean types

    Args:
        obj: The object to canonicalize (dict, list, tuple, str, or primitive)

    Returns:
        Canonicalized version of the object
    """
    if obj is None or isinstance(obj, (bool, int, float)):
        # Preserve primitives as-is (bool must be checked before int)
        return obj
    elif isinstance(obj, str):
        # Trim leading/trailing whitespace from strings
        return obj.strip()
    elif isinstance(obj, dict):
        # Sort keys recursively
        return {k: _canonicalize_tool_args(v) for k, v in sorted(obj.items())}
    elif isinstance(obj, (list, tuple)):
        # Convert tuples to lists and recurse
        return [_canonicalize_tool_args(item) for item in obj]
    else:
        # For other types, return as-is
